import { FC } from "react";
import styled from "styled-components";

const backgroundButton = '/assets/icons/button.svg';

const StyledButton = styled.button`
  width: 8.8125rem;
  height: 2.5rem;
  flex-shrink: 0;
  background: url('${backgroundButton}') / cover no-repeat;
  color: #FFF;
  text-align: center;
  border-radius: 20%;
  font-size: 0.75rem;
  font-style: normal;
  font-weight: 400;
  line-height: 1.125rem;
  border: none;
  cursor: pointer;
  outline: none;
`;

type ButtonProps = {
  text: string;
  onClick?: () => void;
};

const Button: FC<ButtonProps> = ({ text, onClick }) => {
  return <StyledButton onClick={onClick}>{text}</StyledButton>;
};

export default Button;
